import { Button } from 'semantic-ui-react'

export const Dashboard = () => {
  return (
    <div className="h-main-segment">
      <div className="h-flex-column">
        <h3>Main dashboard</h3>
        <Button content='Change name' primary />
      </div>
    </div>
  );
};
